(function(){this.moveUp=function(button){var prevElement;prevElement=$(button.parentElement).prev();if($(button.parentElement).prop("class")===$(prevElement).prop("class")){$(button.parentElement).detach().insertBefore(prevElement)}};this.moveDown=function(button){var nextElement;nextElement=$(button.parentElement).next();if($(button.parentElement).prop("class")===$(nextElement).prop("class")){$(button.parentElement).detach().insertAfter(nextElement)}};this.addRemodalInput=function(button){$('<div class="input-container"> <input class="remodal-input" type="text" /> <a class="btn" onclick="addRemodalInput(this)">+</a> <a class="btn" onclick="deleteRemodalInput(this)">&minus;</a> <a class="btn" onclick="moveUp(this)">&uarr;</a> <a class="btn" onclick="moveDown(this)">&darr;</a> </div>').insertAfter(button.parentElement)};this.deleteRemodalInput=function(button){var className;className=$(button.parentElement).prop("class");if(button.parentElement.parentElement.getElementsByClassName(className).length-1){button.parentElement.remove()}}}).call(this);